import { useState, useEffect } from 'react'
import { NavLink } from 'react-router-dom';
import UserHomePage from './UserHomePage';
const link = {
    width: '100px',
    padding: '12px',
    margin: '0 6px 6px',
    background: 'orange',
    textDecoration: 'none',
    color: 'white',
    borderRadius: '0 px',

  }
const Navbar = (props) => {

        return (
            <span>
                <h1 style={{textAlign:"left"}}>Git_Pet</h1>
                {props.UserNavbar ?
                <nav>
                <NavLink
                  to="/"
                  exact
                  style={link}
                  activeStyle={{
                    background: 'grey'
                  }}
                >Home</NavLink>

                <NavLink
                  to="/reminders"
                  exact
                  style={link}
                  activeStyle={{
                    background: 'grey'
                  }}
                >Reminders</NavLink>

                <NavLink
                  to="/archives"
                  exact
                  style={link}
                  activeStyle={{
                    background: 'grey'
                  }}
                >Archive</NavLink>
              </nav>
            : props.Breeder
            }

      </span>
        )
    }


export default Navbar
